    render(){
        return(
            <Layout>
                <Container textAlign='center'>

                    <Form inverted >
                    <Form.Input width={6} label='Question'
                    />
                <Button>Add Question</Button>
            </Form>


                </Container>


            </Layout>
        );
    }
}
export default Add;
